import PreNavbaar from './components/PreNavbar.js'
import './App.css';
import Navbar from './components/Navbar.js';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Slider from './components/Slider.js';
import data from './data/data.json';
import Offers from './components/Offers.js'
import Heading from './components/Heading.js';
import StarProducts from './components/StarProducts.js'
import HotAccessoriesMenu from './components/HotAccessoriesMenu.js'
import HotAccessories from './components/HotAccessories.js'

function App() {
  return (
    <Router>
      <PreNavbaar />
      <Navbar />
      <Slider start={data.banner.start} />
      <Offers offer={data.offer} />
      <Heading text="STAR PRODUCTS" />
      <StarProducts starProduct={data.starProduct} />
      <Heading text="HOT ACCESSORIES" />
      <HotAccessoriesMenu />
      <Routes>
        <Route exact path="/music" element={<HotAccessories music={data.hotAccessories.music} musicCover={data.hotAccessoriesCover.music} />}>
        </Route>

        <Route exact path="/smartDevices" element={<HotAccessories smartDevice={data.hotAccessories.smartDevice} smartDeviceCover={data.hotAccessoriesCover.smartDevice} />}>
        </Route>

        <Route exact path="/home" element={<HotAccessories music={data.hotAccessories.music} musicCover={data.hotAccessoriesCover.music} />}>
        </Route>

        <Route exact path="/lifestyle" element={<HotAccessories music={data.hotAccessories.music} musicCover={data.hotAccessoriesCover.music} />}>
        </Route>

        <Route exact path="/mobileAccessories" element={<HotAccessories music={data.hotAccessories.music} musicCover={data.hotAccessoriesCover.music} />}>
        </Route>

      </Routes>
    </Router>
  );
}

export default App;
